import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

import FooterLogo from '../../assets/footerLogo.svg'

const Banner = ({}: Props) => {
  return (
     <Styled.MainBanner> 
       <FooterLogo />
     </Styled.MainBanner>
  ) 
};

export default Banner;
